from locust import HttpUser, task, between
import random
import json
import warnings
import urllib3

warnings.filterwarnings("ignore", category=urllib3.exceptions.InsecureRequestWarning)


class GuestUser(HttpUser):
    weight = 20  # 20x guests
    wait_time = between(1, 5)  # Random wait between tasks
    
    @task(5)
    def browse_recipe_feed(self):
        seed = ''.join(random.choices('abcdefghijklmnopqrstuvwxyz', k=2))
        response = self.client.get("/api/v1/feed/recipe", 
                                 params={"seed": seed, "pageNumber": 1, "pageSize": 10}, 
                                 verify=False)
        if response.status_code == 200:
            feed_items = response.json()
            for item in feed_items["items"]:  # Process all items in feed
                with self.client.get(f"/api/v1/recipes/{item['id']}/banner", verify=False, catch_response=True) as banner_response:
                    if banner_response.status_code == 404:
                        # Mark the response as successful since 404 is expected
                        banner_response.success()
                    elif banner_response.status_code != 200:
                        banner_response.failure(f"Got unexpected status code {banner_response.status_code}")
                        
                # Get images for each step
                if 'steps' in item:
                    for step_index in range(len(item['steps'])):
                        with self.client.get(f"/api/v1/recipes/{item['id']}/steps/{step_index}/image",
                            verify=False,
                            catch_response=True) as step_image_response:
                            if step_image_response.status_code == 404:
                                # Mark the response as successful since 404 is expected
                                step_image_response.success()
                            elif step_image_response.status_code != 200:
                                step_image_response.failure(
                                    f"Got unexpected status code {step_image_response.status_code}"
                                )

    @task(5)
    def browse_blog_feed(self):
        seed = ''.join(random.choices('abcdefghijklmnopqrstuvwxyz', k=2))
        response = self.client.get("/api/v1/feed/blog", 
                                 params={"seed": seed, "pageNumber": 1, "pageSize": 10}, 
                                 verify=False)
        if response.status_code == 200:
            # Fetch banner images for all blogs in feed
            feed_items = response.json()
            for item in feed_items["items"]:  # Process all items in feed
                with self.client.get(f"/api/v1/blogs/{item['id']}/banner", verify=False, catch_response=True) as bannerResponse:
                    if bannerResponse.status_code == 404:
                        # Mark the response as successful since 404 is expected
                        bannerResponse.success()
                    elif bannerResponse.status_code != 200:
                        bannerResponse.failure(f"Got unexpected status code {bannerResponse.status_code}")

    @task(5)
    def browse_event_feed(self):
        seed = ''.join(random.choices('abcdefghijklmnopqrstuvwxyz', k=2))
        self.client.get("/api/v1/feed/event", params={"seed": seed, "pageNumber": 1, "pageSize": 10}, verify=False)

    @task(1)
    def browse_user_feed(self):
        self.client.get("/api/v1/feed/users", params={"pageNumber": 1, "pageSize": 10}, verify=False)

    @task(1)
    def search_recipes(self):
        params = {
            "HeaderContains": "recipe",
            "IngredientIds": [1, 2],
            "SortBy": "Header",
            "SortOrder": "asc",
            "pageNumber": 1,
            "pageSize": 10
        }
        self.client.get("/api/v1/recipes/search", params=params, verify=False)

class RegisteredUser(HttpUser):
    weight = 10
    wait_time = between(1, 3)
    token = None
    username = None

    def on_start(self):
        # Generate random user credentials
        rand_num = random.randint(1, 100000)
        self.username = f"testuser_{rand_num}"
        password = "stringA.1"  # Keep password consistent for simplicity
        
        # Register new user
        register_data = {
            "Email": f"{self.username}@test.com",
            "UserName": self.username,
            "Password": password,
            "ConfirmPassword": password,
            "FirstName": "Test",
            "LastName": "User"
        }
        
        register_response = self.client.post("/api/v1/auth/register", 
            json=register_data, 
            verify=False)
        
        if register_response.status_code != 200:
            print(f"Failed to register user: {register_response.text}")
            return

        # Login with newly created user
        login_response = self.client.post("/api/v1/auth/login", 
            json={
                "Identifier": self.username,
                "Password": password
            }, 
            verify=False)
            
        if login_response.status_code == 200:
            self.token = login_response.json()["token"]
            self.client.headers = {'Authorization': f'Bearer {self.token}'}
        else:
            print(f"Failed to login as new user: {login_response.text}")

